import React from 'react';
import './index.css';
import LeftSidebar from './LeftSidebar'
import Video from './Video'
import db from './firebaseConfig';



function UnViewed(props) {

    const docsWillBeDeleted = db.collection(msg.collection).where('id_on_youtube','==',msg.data);
    docsWillBeDeleted.get().then(function(querySnapshot) {
        querySnapshot.forEach(function(doc) {
            doc.ref.delete();
        });
    });

  return (
    <div id="videos-container">
        <LeftSidebar />
        <div id="right-side">
            <div id="videosContainer">

            {
              props.videos.map( video => {
                if(!video.isViewed) {
                   return <Video videoDetails={video} />
                }
              })
            }

            </div>
        </div>
    </div>
  );
}

export default UnViewed;
